objetoCompra:
CONTRATAÇÃO DE EMPRESA, OBJETIVANDO A PARTICIPAÇÃO DOS SERVIDORES MENCIONADOS NO CURSO "CONTRATO DE GESTÃO: PLANEJAMENTO, CELEBRAÇÃO, EXECUÇÃO E PRESTAÇÃO DE CONTAS", REALIZADO PELO GRUPO ORZIL, SENDO 5 (CINCO) SERVIDORES DE FORMA PRESENCIAL, NOS DIAS 15 E 16 DE MAIO DE 2025, NA CIDADE DE BRASÍLIA/DF.

O curso em questão oferece uma abordagem completa, com foco nos seguintes eixos:

Fundamentos legais e conceituais da relação entre Administração Pública e o terceiro setor;

Planejamento e estudos de viabilidade para publicização de serviços;

Processo de chamamento público e critérios de qualificação de Organizações Sociais;

Aspectos técnicos da celebração, execução e fiscalização dos contratos de gestão;

Procedimentos de prestação de contas e recomendações dos Tribunais de Contas;

Adoção de boas práticas de governança e gestão.
